import React, { Component } from "react";
import { Container } from 'react-bootstrap';
import QualityInfo from './*';

import featureSelection from '../images/FeatureSelectionResults.png';
import logerrorFitted from '../images/Fitted_graph.png';
import meanSqErr from '../images/mean_square_error.png';
// import Overview from '../images/FeatureSelectionResults.png';
import QQplot from '../images/QQPlot.png';

class Quality extends Component {
  render() {
    return (
      <Container className="text-center">
        <QualityInfo title={"One"} desc={"One"} image={featureSelection} />
        <QualityInfo title={"Two"} desc={"Two"} image={logerrorFitted} />
        <QualityInfo title={"Three"} desc={"Three"} image={meanSqErr} />
        <QualityInfo title={"Four"} desc={"Four"} image={null} />
        <QualityInfo title={"Five"} desc={"Five"} image={QQplot} />
      </Container>
    );
  }
}

export default Quality;
